import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        <header className="header">React Bus Reservation System
        <img src={logo} className="App-logo" alt="logo"/>
        <h1 className="App-header">Welcome to Metro Bus</h1> 
        </header>
    </div>
  );
}

export default App;
